import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme,
  IconButton,
  alpha 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ 
      minHeight: '100vh',
      bgcolor: '#0A0A0A',
      color: '#fff'
    }}>
      {/* Hero Section */}
      <Box
        sx={{
          position: 'relative',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            width: '140%',
            height: '140%',
            background: 'radial-gradient(circle, rgba(220, 20, 60, 0.15) 0%, rgba(10, 10, 10, 0) 70%)',
            zIndex: 1,
          }
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2 }}>
          <Grid container spacing={8} alignItems="center">
            <Grid item xs={12} md={8}>
              <Box sx={{ 
                textAlign: { xs: 'center', md: 'left' },
              }}>
                <Typography
                  variant="h1"
                  sx={{
                    fontSize: { xs: '3rem', md: '4.5rem', lg: '5.5rem' },
                    mb: 3,
                    background: 'linear-gradient(to right, #fff, rgba(220, 20, 60, 0.8))',
                    WebkitBackgroundClip: 'text',
                    WebkitTextFillColor: 'transparent',
                    fontWeight: 800,
                    letterSpacing: '-0.02em',
                    lineHeight: 1.1,
                  }}
                >
                  Revolutionize Your Study Routine
                </Typography>
                <Typography
                  variant="h2"
                  sx={{
                    fontSize: { xs: '1.5rem', md: '2rem' },
                    mb: 6,
                    color: 'rgba(255, 255, 255, 0.7)',
                    fontWeight: 400,
                    maxWidth: '80%',
                    mx: { xs: 'auto', md: 0 }
                  }}
                >
                  Harness the power of AI to optimize your learning journey and achieve academic excellence.
                </Typography>
                <Box sx={{ 
                  display: 'flex', 
                  gap: 3,
                  justifyContent: { xs: 'center', md: 'flex-start' }
                }}>
                  <Button
                    variant="contained"
                    size="large"
                    onClick={() => navigate('/register')}
                    sx={{
                      py: 2.5,
                      px: 6,
                      fontSize: '1.1rem',
                      borderRadius: '12px',
                      background: 'linear-gradient(45deg, #DC143C, #FF4D6D)',
                      boxShadow: '0 4px 20px rgba(220, 20, 60, 0.3)',
                      '&:hover': {
                        transform: 'translateY(-2px)',
                        boxShadow: '0 6px 25px rgba(220, 20, 60, 0.4)',
                      },
                    }}
                  >
                    Get Started
                  </Button>
                  <Button
                    variant="outlined"
                    size="large"
                    onClick={() => navigate('/login')}
                    sx={{
                      py: 2.5,
                      px: 6,
                      fontSize: '1.1rem',
                      borderRadius: '12px',
                      borderColor: 'rgba(255, 255, 255, 0.2)',
                      color: '#fff',
                      '&:hover': {
                        borderColor: '#fff',
                        background: 'rgba(255, 255, 255, 0.05)',
                      },
                    }}
                  >
                    Learn More
                  </Button>
                </Box>
              </Box>
            </Grid>
          </Grid>
        </Container>

        {/* Animated Scroll Indicator */}
        <Box
          sx={{
            position: 'absolute',
            bottom: 60,
            left: '50%',
            transform: 'translateX(-50%)',
            zIndex: 2,
            cursor: 'pointer',
            opacity: 0.7,
            transition: 'opacity 0.3s',
            '&:hover': { opacity: 1 }
          }}
          onClick={scrollToFeatures}
        >
          <IconButton
            sx={{
              color: '#fff',
              animation: 'float 2s ease-in-out infinite',
              '@keyframes float': {
                '0%, 100%': { transform: 'translateY(0)' },
                '50%': { transform: 'translateY(-10px)' },
              },
            }}
          >
            <KeyboardArrowDownIcon sx={{ fontSize: 40 }} />
          </IconButton>
        </Box>
      </Box>

      {/* Features Section */}
      <Box id="features" sx={{ 
        py: { xs: 12, md: 20 }, 
        bgcolor: '#0F0F0F',
        position: 'relative',
      }}>
        <Container maxWidth="lg">
          <Grid container spacing={8}>
            {[
              {
                icon: <AccessTimeIcon />,
                title: "Intelligent Scheduling",
                description: "Our AI algorithms create personalized study schedules that adapt to your learning patterns and goals."
              },
              {
                icon: <AutoGraphIcon />,
                title: "Performance Insights",
                description: "Get detailed analytics and actionable insights to optimize your study efficiency and track progress."
              },
              {
                icon: <CalendarMonthIcon />,
                title: "Smart Planning",
                description: "Effortlessly manage your academic commitments with our intuitive and responsive planning tools."
              }
            ].map((feature, index) => (
              <Grid item xs={12} md={4} key={index}>
                <Card
                  sx={{
                    height: '100%',
                    background: 'linear-gradient(145deg, rgba(20, 20, 20, 0.9), rgba(30, 30, 30, 0.9))',
                    backdropFilter: 'blur(10px)',
                    border: '1px solid rgba(255, 255, 255, 0.1)',
                    borderRadius: '20px',
                    transition: 'all 0.4s ease',
                    '&:hover': {
                      transform: 'translateY(-10px)',
                      boxShadow: '0 20px 40px rgba(0, 0, 0, 0.4)',
                      border: '1px solid rgba(220, 20, 60, 0.3)',
                    }
                  }}
                >
                  <CardContent sx={{ p: 5 }}>
                    <Box
                      sx={{
                        mb: 4,
                        display: 'inline-flex',
                        p: 2,
                        borderRadius: '16px',
                        background: 'linear-gradient(45deg, rgba(220, 20, 60, 0.2), rgba(255, 77, 109, 0.2))',
                      }}
                    >
                      {React.cloneElement(feature.icon, {
                        sx: { fontSize: 40, color: '#DC143C' }
                      })}
                    </Box>
                    <Typography
                      variant="h5"
                      sx={{ 
                        mb: 2,
                        color: '#fff',
                        fontWeight: 700,
                        fontSize: '1.5rem'
                      }}
                    >
                      {feature.title}
                    </Typography>
                    <Typography
                      variant="body1"
                      sx={{ 
                        color: 'rgba(255, 255, 255, 0.7)',
                        lineHeight: 1.8,
                        fontSize: '1.1rem'
                      }}
                    >
                      {feature.description}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>

      {/* CTA Section */}
      <Box
        sx={{
          py: { xs: 12, md: 20 },
          position: 'relative',
          background: 'linear-gradient(180deg, #0F0F0F, #0A0A0A)',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'radial-gradient(circle at bottom right, rgba(220, 20, 60, 0.15), transparent 70%)',
            zIndex: 1,
          }
        }}
      >
        <Container maxWidth="md" sx={{ position: 'relative', zIndex: 2 }}>
          <Box sx={{ textAlign: 'center' }}>
            <Typography
              variant="h3"
              sx={{
                mb: 4,
                fontSize: { xs: '2.5rem', md: '3.5rem' },
                fontWeight: 700,
                background: 'linear-gradient(to right, #fff, rgba(220, 20, 60, 0.8))',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
              }}
            >
              Ready to Transform Your Learning?
            </Typography>
            <Typography
              variant="h6"
              sx={{
                mb: 6,
                color: 'rgba(255, 255, 255, 0.7)',
                fontSize: { xs: '1.2rem', md: '1.4rem' },
                fontWeight: 400,
                lineHeight: 1.6,
                maxWidth: '800px',
                mx: 'auto'
              }}
            >
              Join thousands of students who are already experiencing the future of learning with our AI-powered platform.
            </Typography>
            <Button
              variant="contained"
              size="large"
              onClick={() => navigate('/register')}
              sx={{
                py: 2.5,
                px: 8,
                fontSize: '1.2rem',
                borderRadius: '12px',
                background: 'linear-gradient(45deg, #DC143C, #FF4D6D)',
                boxShadow: '0 4px 20px rgba(220, 20, 60, 0.3)',
                '&:hover': {
                  transform: 'translateY(-2px)',
                  boxShadow: '0 6px 25px rgba(220, 20, 60, 0.4)',
                },
              }}
            >
              Get Started Now
            </Button>
          </Box>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
